    setCarroSelec(selectedCar);
    alert("El carro seleccionado es " + selectedCar);
  }

  return (
    <div className="car-list">
      {carData.map((car) => (
        <Card key={car.id} val={car} onSelectCar={handleCarSelection} />
      ))}
      <p>Carro seleccionado: {carroSelec}</p>
    </div>
  );
};

